import React from "react";
import { Carousel } from "react-bootstrap";
import autosalon from "../src/photoauto/autosalon.jpg";
import salonauto from "../src/photoauto/salonauto.jpg";
import auto from "../src/photoauto/auto.jpg";

const Main = () => {
  return (
    <Carousel className="py-5">
      <Carousel.Item>
        <img className="d-block w-100" src={autosalon} alt="First slide" />
        <Carousel.Caption>
          <h3>Контакты и адреса</h3>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={salonauto} alt="First slide" />
        <Carousel.Caption className="container d-flex justify-content-between">
          <h3>Контакты и адреса</h3>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100" src={auto} alt="First slide" />
        <Carousel.Caption>
          <h1>Контакты и адреса</h1>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};
export default Main;
